  newHTML += "<p class='temp'>Temp: ".concat(Math.round((data[0].main.temp - 273.5) * 9 / 5 + 32), "&deg <br> <img src='http://openweathermap.org/img/wn/").concat(data[0].weather[0].icon, "@4x.png'></p></div>");

