//--------Buttons---------//
//------------------------//
//button that allows the user to switch between farenheit and celsius temperatures


function tempChangeButton(data) {
  searchBox = document.getElementsByClassName("filler")[1];
  tempButton = document.createElement("button");
  tempButton.innerHTML = "Celsius";
  tempButton.classList.add("btn-outline-info", "btn", "temp-change-btn");
  searchBox.appendChild(tempButton);
  tempButton.addEventListener("click", function (e) {
    if (e.target.innerHTML === "Celsius") {
      displayDataCelsius(data);
      e.target.innerHTML = "Farenheit";
    } else {
      displayDataFarenheit(data);
      e.target.innerHTML = "Celsius";
      currentBtn(data);
    }
  });
}

var resetButton = function resetButton(data) {
  var reset = document.createElement("button");
  var jumbo = document.querySelector(".jumbotron");
  reset.innerHTML = "RESET";
  reset.classList.add("btn-outline-info", "btn", "reset-btn", "filler");
  jumbo.appendChild(reset);
  reset.addEventListener("click", function () {
    location.reload();
  });
  return data;
};

var forecastBtn = function forecastBtn(data) {
  var forecast = document.createElement("button");
  var forecastDiv = document.querySelector(".forecast-div");
  var jumbo = document.querySelector(".jumbotron");
  forecast.innerHTML = "7 Day Forecast";
  forecast.classList.add("btn-outline-info", "btn", "forecast-btn");
  forecastDiv.appendChild(forecast);
  forecast.addEventListener("click", function () {
    var info = document.querySelector(".info");
    info.style.display = "grid";
    jumbo.style.display = "none";
  });
  return data;
};

var currentBtn = function currentBtn(data) {
  var goBack = document.createElement("button");
  var info = document.querySelector(".info");
  goBack.innerHTML = "Current Forecast";
  goBack.classList.add("btn-outline-info", "btn", "current-btn");
  info.appendChild(goBack);
  goBack.addEventListener("click", function () {
    var jumbo = document.querySelector(".jumbotron");
    jumbo.style.display = "grid";
    info.style.display = "none";
  });
  return data;
}; //-----------------------------------//
//------Converter Functions----------//
//-----------------------------------//
//function that converts temperatures to celsius


function displayDataCelsius(data) {
  var temp = document.querySelectorAll(".temp, .temp-min, .temp-max, .temp-feels-like");

  for (i = 0; i < temp.length; i++) {
    if (temp[i].className === "temp") {
      temp[i].innerHTML = "<p>Temp: ".concat(Math.round(data[0].main.temp - 273.15), "&deg <br> <img src='http://openweathermap.org/img/wn/").concat(data[0].weather[0].icon, "@4x.png'></p>");
    }

    if (temp[i].className === "temp-min") {
      for (j = 0; j < data[1].daily.length; j++) {
        temp[i].innerHTML = "<th>".concat(Math.round(data[1].daily[j].temp.min - 273.15), "&deg</th>");
      }
    }

    if (temp[i].className === "temp-max") {
      for (j = 0; j < data[1].daily.length; j++) {
        temp[i].innerHTML = "<th>".concat(Math.round(data[1].daily[j].temp.max - 273.15), "&deg</th>");
      }
    }

    if (temp[i].className === "temp-feels-like") {
      for (j = 0; j < data[1].daily.length; j++) {
        temp[i].innerHTML = "<th>".concat(Math.round(data[1].daily[j].feels_like.day - 273.15), "&deg</th>");
      }
    }
  }
} //-----------------------------------//
//----------Error Handler------------//
//-----------------------------------//
//error handler


function notFound(err) {
  var errAlert = alert("".concat(err, ": City data not found."));
  var html = "<p>City data not found.</p>";
  var infoDiv = document.querySelector(".info");
  infoDiv.innerHTML = html;
  console.warn(err);
}

